B.Um=new A.cy('**H\u01b0\u1ee1ng d\u1eabn s\u1eed d\u1ee5ng:\n1. Ngay sau khi \u0111\u1ecdc h\u1ebft, h\xe3y b\u1ea5m \u0111\u1ed3ng \xfd \u0111\u1ec3 \u0111\u1ebfn trang ch\xednh. Ngay t\u1ea1i trang ch\xednh, sau khi b\u1ea1n ch\u1ecdn m\xf3n \u0103n th\xec s\u1ebd hi\u1ec7n nh\u1eefng qu\xe1n \u0103n \u0111\u1ec3 b\u1ea1n c\xf3 th\u1ec3 xem th\xf4ng tin.\n2. Tab 2 b\xean c\u1ea1nh "Dishes" ch\xednh l\xe0 Random Wheel khi b\u1ea1n kh\xf4ng th\u1ec3 quy\u1ebft \u0111\u1ecbnh nay s\u1ebd \u0103n g\xec.\n3. Tab "New Dishes" s\u1ebd l\xe0 th\xeam qu\xe1n \u0103n v\xe0o m\xf3n \u0103n n\u1ebfu b\u1ea1n th\u1ea5y qu\xe1n \u0111\xf3 ch\u01b0a c\xf3 tr\xean web.\n4. N\xfat ch\u1ec9nh s\u1eeda g\xf3c tr\xean c\xf9ng b\xean ph\u1ea3i s\u1ebd \u0111\u1ec3 update qu\xe1n \u0103n v\xe0 delete n\u1ebfu qu\xe1n s\u1eadp ti\u1ec7m :)))))\n\n**P/s: T\u1edb ngh\u0129 l\xe0 \u1edf th\u1eddi \u0111\u1ea1i 4.0, m\u1ed9t chi\u1ebfc web \u0111\u01a1n gi\u1ea3n nh\u01b0 n\xe0y th\xec s\u1ebd kh\xe1 d\u1ec5 \u0111\u1ec3 m\u1ecdi ng\u01b0\u1eddi thao t\xe1c th\xf4i, v\xe0 n\u1ebfu m\u1ecdi ng\u01b0\u1eddi c\xf3 g\xf3p \xfd v\u1ec1 giao di\u1ec7n, h\xe3y li\xean h\u1ec7 v\u1edbi t\u1edb nh\xe9 @@\n\n**Fb: H\xf4m nay fb s\u1eadp web, c\u1eadp nh\u1eadt sau nh\xe9:)))\n\n**Mail: xuanthai.bxt@gmail.com\n',null,B.hS,null,null,null,null,null,null,null)
