B.Ut=new A.cy("**Thank you for using xuanthai's website.\n\n**This website was created for some very funny reasons. Initially, I intended to write it using Python, but in the end, I decided to use Flutter, and it was probably the right choice.\n\n**I spent quite a bit of time making this, and I had to watch a lot of Indian ITers' videos. I hope everyone, after each good meal (or maybe not-so-good), will update the information on the website, so \"What to eat today\" can be even more useful.\n\n**Once again, thank you everyone ^^.\n",null,B.hS,null,null,null,null,null,null,null)
